import React from "react";
import "fontsource-cascadia-mono";
import { useNavigate, Link } from "react-router-dom";

export default function Shop() {
    let navigate = useNavigate();
    return (
        <div className="dropdown">
            <button className="dropbtn">SHOP</button>
            <div className="dropdown-content">
                <Link to={`/home/products/Annual-Flowers`}>Annual Flowers</Link>
                <Link to={`/home/products/Garden-Plants-&-Flowers`}>Garden Plants & Flowers</Link>
                <Link to={`/home/products/Garden-Supplies-&-Plant-Care`}>Garden Supplies & Plant Care</Link>
            </div>
        </div>
    )
}
